import { Container } from "react-bootstrap";
import Header from "./Header/Header";

const DefaultLayOut = ({ children }) => {
  return (
    <>
      <Container>
        <Header />
        {children}
      </Container>
    </>
  );
};

export default DefaultLayOut;
